import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';

const Cardd = (props) => (
  <Card key={props.id} style={{backgroundColor:"#eeeeee", marginBottom:30, borderRadius:20, marginTop:20, padding:100, flexDirection:"column", justifyContent:"center", alignItems:"center"}}>
    <Card.Content >
      <Title style={{color:"black"}}>{props.name}</Title>
      <Paragraph style={{color:"black"}}>{props.species}</Paragraph>
    </Card.Content>
    <Card.Cover style={{ width: 250, height: 330}}  source={{ uri: props.image }}  />
    <Card.Actions>
      <Button style={{color:"white"}}>Ver</Button>
    </Card.Actions>
  </Card>

);

export default Cardd;
